import { createSlice } from "@reduxjs/toolkit";

const initialState = {
    danhSachGheDangDat:[
        {soGhe:'A5',gia:75000}
    ]
}

const DatVeReducer = createSlice({
    name:'DatVeReducer',
    initialState,
    reducers:{
    changeGhe:(state,action)=>{
        console.log(action)
        }
    }
})


export const {changeGhe} = DatVeReducer.actions

export default DatVeReducer.reducer
